  SWIG_addvarlink(SWIG_globals(),(char*)"_pause_thread",Swig_var__pause_thread_get, Swig_var__pause_thread_set);
  SWIG_addvarlink(SWIG_globals(),(char*)"_steps",Swig_var__steps_get, Swig_var__steps_set);
  SWIG_addvarlink(SWIG_globals(),(char*)"_cycles",Swig_var__cycles_get, Swig_var__cycles_set);
  SWIG_addvarlink(SWIG_globals(),(char*)"_avr",Swig_var__avr_get, Swig_var__avr_set);
  SWIG_addvarlink(SWIG_globals(),(char*)"_terminate",Swig_var__terminate_get, Swig_var__terminate_set);
  SWIG_addvarlink(SWIG_globals(),(char*)"_thread",Swig_var__thread_get, Swig_var__thread_set);
